var segments = [];
segments[11000001]="Cath Almaine etir Laigniu ocus Uí Néill.";
segments[11000002]="teirtíd Decembris rocuired in cath-sa. Cauis in chatha-sa .i. in bóroma romaith Fínnachta do Mo-Ling a tobach d'Fhergal, ocus is .i. ná rofhuilngetar Laigin.";
segments[11000003]="Nís-tucsat Laigin do Loingsech mac Áengusa ocus ní tucsat do Chongal Chinnmagair, cia rofuilngetar mór d'imned ó Chongal, ocus ní mó dno rop áil dóib a tabairt d'Fhergal, uair rotairisnigset i m-briathraib Mo-Ling rogell ná bertha uathu tré bithu in bórama ó Laignib.";
segments[11000004]="Ba trom trá la Fergal sin .i. Laigin do nemchomall a n-gellta fris, co rofhuacrad sluaiged dírecra dímór uad for Leith Chuinn .i. for Eogan ocus for Conall ocus for Airgiallaib ocus Mide in cethramad bliadain a fhlaithiusa féin, nó i tres bliadain déc ut quibusdam placet, do thobach na bórama.";
segments[11000005]="Ba fata trá robás ocin tinól-sain; uair is ed at-beired cach fer do Leith Chuinn cosa roiched in fuacra .i. 'dia tí Donn Bó arin sluagad, ragat-sa.";
segments[11000006]="Donn Bó immorro mac baintrebthaige eiside d'Fheraib Rois, ocus ní dechaid lá ná aidche a taig a máthar immach riam, ocus ní raibe i n-Éirinn uile bud caíme nó bud ferr cruth nó delb nó dénam inás.";
segments[11000007]="Ni raba i n-Éirinn uile bud gríbda nó bud ségainne inás, ocus is uad bud ferr rann espa ocus ríg-scéla for doman.";
segments[11000008]="Is é bud ferr do glés ech ocus do innsma shleg ocus d'fhige fholt, ocus bud ferr fri aichne 'na einech de quo dicitur:";
segments[11000009]="Áille macaib Donn Bó báid, binne a laíde luaidit beoil, áine ócaib Inse Fáil, rotócaib táin trilse a threoir.";
segments[11000010]="Nír léic dno a máthair Donn m-Bó la Fergal co tucad Máel mac Faílbe meic Erannáin meic Chrimthainn, comarba Coluim Chille fria aisec beo, ocus co tuc-saide Colum Cille dno dia chinn co rísed Donn Bó slán dia thaig féin a crích Laigen.";
segments[11000011]="Tochomla dno Fergal for sét.";
segments[11000012]="Robátar dna lucht eolais reime; nírbo maith int eolas do-ratsat dó .i. i cumgaib cacha conaire, ocus i n-aimréidib cacha conaire co ráncatar Cluain Dobail i n-Almaine.";
segments[11000013]="Is ann boí Áedán, clam Cluana Dobail, ar a chinn.";
segments[11000014]="Do-rónsat dno na sluaig míchostad .i. a áen-bó do marbad ocus a fuine ar beraib 'na fhiadnaise ocus a thech do breith dia chinn ocus a loscad.";
segments[11000015]="Co n-érbart in clam comba dígal co bráth for Uíb Néill in dígal do-bérad in Coimdid for sin.";
segments[11000016]="Ocus táinic in clam reime co pupall Fergail ocus bátar rígrad Leithe Cuinn uile ar a chinn 'sin phupall in tan-sin.";
segments[11000017]="Roboí in clam oc acaíne a imnid 'na fiadnaise; ní táinic cride neich díb fair acht cride Con-Brettan meic Congusa, ríg Fer Rois, ocus is .i. nába aithrech do Choin-Brettan, uair ní térna rí do nech roboí isin phupall acht Cú-Brettan mac Congusa a áenar asin chath.";
segments[11000018]="Conid ann at-bert Cú-Brettan:";
segments[11000019]="At-ágar cath forderg flann, a fhir Fhergaile at-glinn, brónaig muinter Meic Maire iar m-breith in taige dia cinn.";
segments[11000020]="Bó in chlaim, rogáet i n-degaid a daim, mairg láim rotholl a bratt, ar ní timchomart mac m-Brain.";
segments[11000021]="Is ann-sin as-bert Fergal fri Donn m-Bó:";
segments[11000022]="‘déna airfited dúin, a Duinn Bó, fo bíth is tú as dech airfitid fail i n-Éirinn .i. i cúisig ocus i cuislennaib ocus i cruittib ocus rannaib ocus ráidsechaib ocus ríg-scélaib Éirenn, ocus isin maitin-se imbárach do-béram-ne cath do Laignib.’";
segments[11000023]="‘Acc,’ ar Donn Bó, ‘ní cumcaim-se airfited duit-si innocht ocus ním-thá áen-gním díb-sin uile do thaidbsin innocht, ocus cipsí airm i rabai-si imbárach, ocus i m-beo-sa do-dén-sa airfited duit-si.";
segments[11000024]="Dénad immorro in ríg-drúth, úa Maigleine, airfited duit innocht.’";
segments[11000025]="Tucad úa Maigleine chucu iar tain.";
segments[11000026]="Rogab-saide oc innisin chath ocus chomrama Leithe Cuinn ocus Laigen ó Thogail Tuama Tenbath, .i. Denna Ríg, in romarbad Cobthach Cáelbreg conice in n-aimsir-sin, ocus níba mór cotalta do-rinned leo in aidche-sin la mét ecla leo Laigen ocus la méit na doininne .i. uair aidche fhéile Finniain gaimrid sin.";
segments[11000027]="Imthús Laigen do-lotar-saide i Cruachan Cláenta, dáig ní maid for Laigniu dia n-dernat a comairle ann, ocus corop a saide tísat dochum in chatha.";
segments[11000028]="Lotar iar sain co Dinn Canainn.";
segments[11000029]="Con-ráncatar trá isin maitin arnabárach na catha cechtarda, naí míle do Laignib, míle ar fhichit immorro do Leith Chuinn.";
segments[11000030]="Is cruaid ocus is feochair rocuired in cath-sa leith for leith, ocus rogab cách 'na chomraicib ann.";
segments[11000031]="Roba dímór la innise comrama na láech Laigen ocus láech Leithe Cuinn.";
segments[11000032]="As-bert co n-accas Brigit ós cinn Laigen: at-ches dno Colum Cille ós cinn Úa Néill.";
segments[11000033]="Romemaid iaram in cath ré Murchad mac Brain, ocus ré n-Áed Menn mac Colcan, ríg Laigen Desgabair.";
segments[11000034]="Romarbad Fergal ann.";
segments[11000035]="Áed Menn ocus Dúnchad mac Murchada romarbsat Fergal fadeisin ocus Bile mac m-Báin, ríg n-Alban; is uaid ainmnigther Corrbile i n-Almaine.";
segments[11000036]="Is é dno Áed Menn romarb Donn m-Bó.";
segments[11000037]="Ní torchair immorro Fergal co torchair Donn Bó.";
segments[11000038]="Romarbad dno sesca ar chét amas in dú-sin.";
segments[11000039]="A coimlín féin romarbait Laigin 'sin chath-sin do Leith Chuinn .i. naí míle ocus naí n-geilte díb do dol for geltacht ocus cét ríg do rígaib.";
segments[11000040]="Atá Cnocc Fergail ann-sin.";
segments[11000041]="Rocuirset Laigin ilaig commaídme ann dno.";
segments[11000042]="Unde:";
segments[11000043]="Deod laithe Almaine, iar cosnam buair Bregmaine, ro-lá badb bélderg birach ilach im chenn Fergaile.";
segments[11000044]="Scarais Murchad fri midlaig, brogais a triúna i talmain, do-sói fáebar fri Fergail co féin dermair des Almain.";
segments[11000045]="Bath ann cét ruirech rathach, cruadach costadach carnach, im naí n-gelta cen míne, im naí míle fer n-armach.";
segments[11000046]="Rogabad ann-sain in drúth, uá Maigleine, ocus do-ratad fair géim drúith do dénam ocus do-rigne.";
segments[11000047]="Ba már ocus ba binn in géim-sin, co mair 'géim uí Maigleine' ó shin ille oc drúthaib Éirenn.";
segments[11000048]="Rogatad a chenn iar tain d'Fhergal, ocus rogatad a chenn don drúth.";
segments[11000049]="Roboí mac alla géime in drúith 'sin áer co cenn trí lá ocus trí n-aidche.";
segments[11000050]="Is de as-berar ‘géim uí Maigleine oc tafann na fer 'sin mónaid.’";
segments[11000051]="Do-luid dno Áed Laigen mac Fithchellaig, rí Úa Maine Connacht, i ráen madma, ocus teichid co n-epert fria macaib:";
segments[11000052]="‘nácham-fhácbaid, a macu, bud ferrde bar máthair frib mo breith-se lib.’";
segments[11000053]="‘Nít-bérat’, ar Laigin.";
segments[11000054]="Conid ann-sin romarbad Áed Laigen, rí Uá Maine.";
segments[11000055]="Ro-siachtatar immorro a meic Áeda Laigen im Áed n-Alláin mac Fergaile co Lilcach airm i m-boí Mo-Díchu mac Amargein ocus in Gall Cráibdech.";
segments[11000056]="Conid ann-sin claidisit Uí Néill ocus Connachta clad na cille ocus iat i richt na cléirech, ocus is amlaid-sin rosáerait trí mírbaile na náem, co fail cotach Úa Néill ocus Chonnacht ó shin ille 'sin chill-sin.";
segments[11000057]="Unde Áed Alláin cecinit:";
segments[11000058]="Ní fuaramar ar talmain Almain badid réidithir, Ní ráncamar iarsin chath Lilcach badid néimithir.";
segments[11000059]="Ba buadach trá in lá-sin do Laignib.";
segments[11000060]="Roanacht immorro Cú-Brettan mac Congusa, rí Fer Rois, arna runnu do-rigne in aidche reime.";
segments[11000061]="Connail na ríg bátar Laigin in aidche-sin oc ól fhína ocus meda, iar cur in chatha, co subach soimenmnach, ocus cách díb oc innisin a chomrama is iat medraig, medarchaín. Is ann-sin roráid Murchad mac Brain:";
segments[11000062]="‘do-bérainn carpat ceithre cumala ocus mo ech ocus m'errad don láech noragad isin n-ármach ocus do-bérad comartha chucainn as’.";
segments[11000063]="‘Ragat-sa,’ ar Báethgalach, láech di Mumain.";
segments[11000064]="Geibid a chath-errad catha ocus comlainn imme, co ráinic co airm i m-boí corp Fergaile; co cuala ní, in n-escaire isin áer ós a chinn co n-epert, ar roclos uile:";
segments[11000065]="‘timarnad dúib ó ríg secht nime; dénaid airfited do bar tigerna innocht .i. d'Fhergal mac Maíle-dúin, cia do-rochrabair sunn uile in bar n-áes dána etir cuislenn-chu ocus cornaire ocus cruittire; ná tairmescad airfhuath nó écomnart sib d'airfited innocht d'Fhergal’.";
segments[11000066]="Co cuala iaram int óclach in cúisig ocus in ceol sírechtach, co cuala dna 'sin tum luachra ba nesa dó in dord fiansa ba binne ceolaib.";
segments[11000067]="int óclach 'na dochum. ‘Ná tair ar m'amus’, ar in cenn fris.";
segments[11000068]="‘Ceisc, cia tú’, ar int óclach.";
segments[11000069]="‘Ní ansa, mise cenn Duinn Bó’, ar in cenn, ‘ocus naidm ronaidmed form irraír airfited in ríg innocht, ocus ná airchóitid dam’.";
segments[11000070]="‘Caide corp Fergail sunn?’, ar int óclach.";
segments[11000071]="‘Is é do-aitne frit anall’.";
segments[11000072]="‘Ceisc, indat-bér lem?’, ar int óclach.";
segments[11000073]="‘Is tú as dech lem nom-bera’, ar in cenn, ‘acht ráth Críst dot chinn dianom-ruca, co tuca mé ar amus mo cholla doridise’.";
segments[11000074]="‘Do-bér éicin’, ar int óclach.";
segments[11000075]="Ocus impói int óclach ocus in cenn lais conice Connail.";
segments[11000076]="Ocus fuair Laigniu oc ól ar a chinn 'sin aidche chétna.";
segments[11000077]="‘In tucais comartha lat?’, ar Murchad.";
segments[11000078]="‘Tucas’, ar int óclach, ‘cenn Duinn Bó’.";
segments[11000079]="‘Foraim arin uaitne út thall’, ar Murchad.";
segments[11000080]="Tucsat in sluag uile aichne fair, corop é cenn Duinn Bó, ocus is ed roráidset uile:";
segments[11000081]="‘Dirsan duit, a Duinn Bó.";
segments[11000082]="Ba cáem do delb.";
segments[11000083]="Déna airfited dúinn innocht, feib do-rignis dot thigerna imbuarach’.";
segments[11000084]="Impaigther a aiged dno, ocus at-racht a dord fiansa attruag ar aird, co m-bátar uile oc caí ocus oc tuirse.";
segments[11000085]="Idnaiccid in láech cétna in cenn dochum a cholla amal rogell, ocus cóirgid é ar a méide.";
segments[11000086]="trá acht, ráinic Donn Bó co tech a máthar. Uair is iat trí inganta in chatha-sa .i. Donn Bó; do rochtain 'na bethaid conice a thech dar cenn m-bréithre Coluim Chille, ocus géim in drúith, uí Maigleine, trí lá ocus trí aidche 'sin áer, ocus na naí míle do fhoruaisligud in míle ar fhichit.";
segments[11000087]="Unde dicitur:";
segments[11000088]="Cath Almaine, ard in gein, mór in gnim Decembeir robris Murchad, mórda crech, mac Brain la láechraid Laignech.";
segments[11000089]="Memaid ar Fergal Fáil, ar mac Maíle-dúin dermáir co meiltis muille fo leirg ar lintib fola fordeirg.";
segments[11000090]="Ocht ríg ochtmogat iar fír, naí míle cen imairím do Leith Chuinn, comal n-gnáe, do-rochair ann ar áen-cháe Naí n-geilte for geltacht de, lotar díb for Fid n-Gaible, rocláechlaigset dath iar tain ara n-gléthe Cath Almain.";
segments[11000091]="Haec sunt nomina regum qui interfecti sunt in hoc bello.";
segments[11000092]="Hi sunt quidem do Shíl Chuinn:";
segments[11000093]="Fergal mac Maíle-dúin cum militibus suis;";
segments[11000094]="Forbasach, rí Bógaine;";
segments[11000095]="Fergal úa Aithechda;";
segments[11000096]="Fergal mac Echach Lemna, rí Tamnaige.";
segments[11000097]="Congalach mac Conaing;";
segments[11000098]="Éicnech mac Conaing;";
segments[11000099]="Coibdenach mac Fiachaid;";
segments[11000100]="Conall Cráu;";
segments[11000101]="Fergus Glút;";
segments[11000102]="Muirges mac Conaill;";
segments[11000103]="Lethaithech mac Con-charat;";
segments[11000104]="Anmchaid mac Con-charat;";
segments[11000105]="Áedgein úa Maithgne;";
segments[11000106]="Nuada Uirc, rí Guill ocus Irguill; decem nepotes Maíle-fithrig.";
segments[11000107]="It é-sin ríg Úa Néill in Tuaiscirt.";
segments[11000108]="Hi autem qui sequuntur Uí Néill in Deiscirt.";
segments[11000109]="Ailill mac Feradaig;";
segments[11000110]="Suibne mac Congalaig;";
segments[11000111]="Áed Laigen úa Cernaig;";
segments[11000112]="Nia mac Cormaic;";
segments[11000113]="Clothgna mac Colcan;";
segments[11000114]="Tadc mac Aigthide;";
segments[11000115]="Dub-dá-chrích mac Duib-dá-bairenn;";
segments[11000116]="Menchosach mac Gamnaig;";
segments[11000117]="Élódach mac Flainn ó Scice;";
segments[11000118]="Dúnchad úa Fiachrach; mac Con-loingse; mac Maíle-móna;";
segments[11000119]="Doiriad mac Conla;";
segments[11000120]="Flann mac Áda Odba; mac Con-choingelt; mac Tuathail meic Fháelchon;";
segments[11000121]="Innrechtach mac Taidc; mac Garbáin; dá úa Maíl-cháich; dá mac Ailéine;";
segments[11000122]="Fócarta úa Domnaill;";
segments[11000123]="Ailill mac Conaill Graint;";
segments[11000124]="Fidgal mac Fithchellaig;";
segments[11000125]="Dub-díl úa Daimíne & fratres ejus; dá mac Muiredaig meic Innrechtaig;";
segments[11000126]="Nuada mac Duib-dúnchuire;";
segments[11000127]="Rechtabra úa Cumascaig; úa Maine Cer Cer Cera;";
segments[11000128]="Fergus úa Eogain nó Leogain;";
segments[11000129]="Flaithemail mac Dlúthaig;";
segments[11000130]="Donngalach úa Áengusa;";
segments[11000131]="Conall Menn, rí Ceinéil Chairpre;";
segments[11000132]="Mac-Erca mac Maíle-dúin; trí uí Nuadat;";
segments[11000133]="Flann mac Írgalaig;";
segments[11000134]="Áed Laigen mac Fithchellaig;";
segments[11000135]="Niall mac Muirgesa:";
segments[11000136]="Dolore autem & frigore mortui sunt c tar éis chatha Almaine i t-torchair Fergal mac Maíle-dúin.";
segments[12000001]="Cath Almaine and-so.";
segments[12000002]="Baí cocad mór iter Chathal mac Findguine & Fergal mac Maíli-dúin fri ré fota.";
segments[12000003]="Cathal mac Finngune meic Con-gen-máthair meic Cathail meic Áeda Flaind Cathrach meic Cairpre meic Crimthainn Sreb meic Echach meic Áengusa meic Nadfraích.";
segments[12000004]="Docrech Laigniu trá Fergal mac Maíli-dúin ar ulcuib fria Cathal mac Findgaine.";
segments[12000005]="Roairg dno Cathal mac Findgani Mag m-Breg uili co n-dernsad síd & comosad.";
segments[12000006]="Do-luid trá fecht and Fergal atuaid do saigid bóroma ar Laignib co feraib in tuaiscirt uime.";
segments[12000007]="Ba fada trá robás acan tinól-sin la Fergal.";
segments[12000008]="Is ed ad-bered cach fer fris:";
segments[12000009]="‘dia n-dechad Dond Bó lat, ragad-sa lat’.";
segments[12000010]="Baintrebthach immorro máthair Duind Bó.";
segments[12000011]="Is amlaid immorro baí Dond Bó; mac as áine & is áilli & is chaíme baí a n-Érinn ésen.";
segments[12000012]="Nír léic a máthair do Dunn Bó dul aráen re Fergal co tardad rátha & cora Coluim Chilli fris co tísad slán ar cúlu.";
segments[12000013]="Tuctha dó sin.";
segments[12000014]="Tic ar sin Fergal d'indsaigid Laigen.";
segments[12000015]="Bádar immorro droch-eolaig ria Fergal & tucsad ar aimréigib na críchi uili h-é.";
segments[12000016]="Is í iarum conair thucsad an eolaig .i. do Chluain Dolcain, & gabsad longport ar brú na cilli & tucsad imadall mór arin cill .i. araili clam baí in tan-sin & áen-bó ogai; táncas íar tain docum in chlaim co robenad a tech dia chind, & tardad forgom do gaí fair co tarla triana brat & co romarbad a én-bó, & rohindeonad ar beraib iaraind in bó iar sin.";
segments[12000017]="Is ann-sin as-bert Cú-Bretan mac Áengusa rí Fer Rois.";
segments[12000018]="At-ágar cath forderg fland, a firg Fhergaile ad-glind, ad brónaig muinter Meic Muiri ar m-breith a taigi dia chind.";
segments[12000019]="Bó in chlaim, dogáed a n-degaid an doim, mairg láim ler tolled a brat ria techt i cath co mac m-Brain.";
segments[12000020]="Dá m-beith neach do-berad cath matren dreman ria mac m-Brain; andsa leam oldás ind ráe in cáe rocanad in chlaim.";
segments[12000021]="Is and-sin as-bert fria Dond m-Bó in aidhchi-sin ré tobairt in chatha:";
segments[12000022]="‘déntar let ar n-airfided innocht a Duind Bó’ ar Fergal, ar is é Dond Bó fer airfidig as dech baí i nn-Érinn iter senchas & rundu & cuslind & cach ciniúl airfidig archeana.";
segments[12000023]="Ad-bert Dond Bó:";
segments[12000024]="‘ní fédaim-sea ém áen-fhocol ar mo bél anocht & airfided nech aili thú anocht.";
segments[12000025]="Acht chena cidbé airm a rabais amárach d'agaid do-dén-sa th'airfided.";
segments[12000026]="Dénad iarum úa Maiglindi innocht ar n-airfided ar is é ríg-drúth Érenn hé’.";
segments[12000027]="Do-rónnad dno amlaid-sin an aidchi-sin.";
segments[12000028]="Lodar Laigin arnamárach co Cruachan Cláenta & táncadar íar sin co Dind Canand.";
segments[12000029]="Is and-sin trá con-ráncadar Leth Cuind & Laigin ceand i cend & rocommórad and-sin trá ind urgal & inn imargul is fíchda roferad i n-Érinn riam.";
segments[12000030]="Ba fortrén ba ferrda rofiged in gleo guineach gáimtheach in tan-sin.";
segments[12000031]="Badar imda trá and-sin meic ríg & ruirech & rodáeine & tánaisti flatha fodésin & sáerclanda socheineóil a n-égmais a n-anma.";
segments[12000032]="Ba buideach badb birach bélsalach in uair-sin & bad brónaid máthair báeid ig gul & ig golgairi ac caíneadi na sáercland in uair-sin.";
segments[12000033]="Ní roan trá & nír thairis menma Coluim Cilli ar Uíb Néill isin cath-sin la faicsin m-Brigdi ós cath Laigen ac fubdad slóig Lethi Cuind, conad la faicsin Brigdi amlaid-sin romebaid in cath ar Fergal & ar Leth Cuind ria n-Áed .i. rí Descirt Laigen, & is ésin romarb Fergal & Buan mac Baili rí Alban & Dond Bó, & co n-dorchair Dond Bó didiu ní romarbad Fergal.";
segments[12000034]="Atá didiu Cnoc & Brí Buain meic Baile rí Alban and-sin béos.";
segments[12000035]="Seasca ar cét romarbad and d'amsaib in ríg and .i. Conall Meand rí Ceneóil Cairpre, & Forbhasach rí Ceneóil Bóguine, & Fergal úa h-Aithechda, & Fergal mac Echach Leamnai rí Tamnaigi, & Condalach mac Conaing, & Éignech mac Olcan rí na n-Airter, Coibdinach mac Fiachrach, & Muirgius mac Conaill, Lethait mac Con-carad, & Áedgen úa Mathgne, Nuada mac Oirc rí Gall, & dech uí Máeili-fithrig.";
segments[12000036]="At é and-sin trá ríga in tuaiscirt do-ecrsad isin chath-sin.";
segments[12000037]="At iat-so immorro ríga Uá Néill in Deiscirt romarbaid and .i. Fland mac Ragnaill, Ailill mac Feradaig, Áed Laigen úa Cernaig, Suibni mac Congalaig, Nia mac Cormaic, Dub-dá-crích mac Duib-dá-inber, Ailill mac Conaill Grant, Flaitheamail mac Dlúthaig rí Corpre Cruim, Fergus ó h-Eogain.";
segments[12000038]="Hic totus numirus de reigibus ceciderunt & alii novem uolatiles septem millia cecinerunt in bello ab utroque exercitu.";
segments[12000039]="inde Nuadu úa Lomthuile:";
segments[12000040]="Medón laí a n-Almaine, ag cosnum buair Bregmaine, ro-lá badb bélderg birach ilach im cheand Feargaile.";
segments[12000041]="Scarais Murcad fri midlaig, i m-rogaes trén for talmain; do-sói fóebar fri Feargal, co fén n-dermair de Almain.";
segments[12000042]="Ad-bath cét ruireach rathach ruamach, co cét costadach carnach, im náei gelta gin míne, im secht míli fer n-armach.";
segments[12000043]="A tertkalendas Decimper ar aí laithi mís gréne & dia Mairt ar aí laithi sechtmaine rofigead cath Almaine.";
segments[12000044]="Is and-sin rogabad úa Maiglindi, .i. in ríg-drúith, la Laigniu & la Murchad & do-radad fair gém druad do dénam.";
segments[12000045]="Ba mór trá in géim-sin & ba bind co fuil gém úa Maiglindi ac sochaide d'feraib Érenn ó sin ille.";
segments[12000046]="Do-radad iar sin bém dar a munél cor beanad a cheand de.";
segments[12000047]="Ad-beraid aroili na h-eolach robaí gém uí Maiglindi isinn áer co ceann trí tráth.";
segments[12000048]="Is de-sin atá gém uí Maiglindi ac tofund na fer isin mónaid.";
segments[12000049]="Is and-sin ad-bert araili láech maith do Conachtaib ri macaib:";
segments[12000050]="‘nácham-fácbaid a gillu’, ol sé, ‘bid fearrdi frib menma bar máthar dianum-rucasa lib.’";
segments[12000051]="Impóid iar sin fris & tócbaid leo h-é.";
segments[12000052]="Do-luid Áed Allán mac Feargaile asin cath co ránic in Gall dár comainm Lilach & adchis-eom in Gall .i. Lisicach nó Lilcach leis dia comairci.";
segments[12000053]="Pruidens didiu ainm in Gaill-sin; co n-deachaid int aingel ar in cleith a richt in clérig, air do-arngert bithanad isin chill-sin.";
segments[12000054]="Is and-sin ad-bert Áed Allán in rand-sa:";
segments[12000055]="Ní ráncamar ar talmain Almain bade rédigthir, ní fuaramar iarsin cath Lilcach ulchach badi néimidhir.";
segments[12000056]="Roadnocht immorro Cú-Bretan mac Áengusa .i. rí Fer Rois.";
segments[12000057]="Bádar Laigin trá ac fleadugad & ag ól an aidchi-sin.";
segments[12000058]="Is ann-sin ad-bert Murchad mac Brain re h-áen dona sluagaib bádar isin tig teacht ar ceand cind duine isinn ármuig, & do-bérad secht cumala dontí noradad ri sin.";
segments[12000059]="‘Radad-sa and’, ar áen-óclach amna d'feraib Muman.";
segments[12000060]="Luid-sen amach & a errad catha & comlaind uime co rocht co h-airm a m-baí corp Fergail.";
segments[12000061]="Amal baí, co cualai inní nechtair isinn áer ar ro-closs uili fris hé.";
segments[12000062]="‘Timarnad dúib ó maig nime airfided bar tigerna do dénam anocht .i. Fergal mac Maíli-dúin; do-rochrabair uili in bar n-éicsib sunn aráen re bar tigerna .i. ri Feargal.’";
segments[12000063]="Ro-chualadar immorro in ceol iar tain iter áes dána & cornairi & cusleanncha & cruitiri, co cuala immorro na ceola écsamla & ní cuala riam ná iarum ceol bud ferr; co cuala didiu in guth isin tup luacra; ba bindi in ceol í-sin anád ceola in domain.";
segments[12000064]="int ócláech iar sin ina docum. ‘Ná tairr cucum’, ar in cenn fris; ‘cid ón cindus ataí’, ar int ócláech; ‘misi Donn Bó’, ar in ceand, ‘& ronaisced orm airfided dom thigerna anocht .i. do Fergal.";
segments[12000065]="Ní do Murchad itir’, ar in ceand.";
segments[12000066]="‘Cait Fergal fén’, ar ant óclach:";
segments[12000067]="‘is é a chorp in taitneamach rit anall’, ar in ceand.";
segments[12000068]="‘Cest’, ar int ócláech:";
segments[12000069]="‘nod-bér lium’.";
segments[12000070]="‘Is tú is deach lium nom-bera ar bith’, ar in ceand, ‘acht namá menum-berad Críst mac Dé’.";
segments[12000071]="‘Dianom-bera’, ar in cend, ‘curam-tuca dorigisi com cholaind’.";
segments[12000072]="‘Dot-bértar éigin’, ar int óclach.";
segments[12000073]="Do-chuaid immorro int ócláech dia thig & in ceand lais.";
segments[12000074]="‘An tucuis lat ní asan ármuig’, ar Murchad.";
segments[12000075]="‘Tucus trá’, ar int ócláech; ‘tobair aran uaitni thall’, ar Murcad.";
segments[12000076]="Do-rat in slóg uili aichni, arin ceand & ráidsead uli:";
segments[12000077]="‘Nírb irsun duid a Duind Bó bith amlaid-sin.";
segments[12000078]="Is tú is áilli & is fearr airfidid baí i n-Érinn’.";
segments[12000079]="‘Maith’, ar in láech, das-bert a maig in ceand:";
segments[12000080]="‘déna airfided dúind, a Duind Bó, fo dáig Meic Dé .i. Ísa Críst i n-deachaid gnúis.";
segments[12000081]="Airfid Laigniu anocht feib roairfidis do thigerna ó chianaib’.";
segments[12000082]="Impáis iarum a aiged re fraighidh in tigi ar dáig cumad dorcha dó & tócbais a chrúisich ós aird combo bindi cach ceol ar tuind talman.";
segments[12000083]="Co mbádar in slóg uili ag caí & ac toirrsi ria truaigi & ri taidhiúiri in ciúil rochan.";
segments[12000084]="In tan trá ba scíth in sluag ac toirrsi ac éstecht frisin ceol, luid int ócláech cétna lasin cend co riacht an corp.";
segments[12000085]="‘Maith ém’, ar in ceann risin ógláech; ‘tuidmi mo cheand rim chorp’; córaigis didiu int ócláech in cend risin colaind & leanaid de fo cétóir; do comall bréithri Coluim Cille ón, air is é Colum Cille baí na slánaigecht fona techt i tuaig do-ridisi docum a máthar co roindised scéla in chatha & aiged Fergail di-si & do chách.";
segments[12000086]="A nn-écmais dno Cathail meic Findgaine rofhersad Laigin in cath-sa Almaine, & rob olc ria Cathal in cath do cur ina aémais fén, & ad-cualadar Laigin grúg Cathail do beith riu, conad h-í comairli do-rónsad.";
segments[12000087]="Ceann Fergail do breith co Cathal da commaídeam in gníma; rucad iar sin in ceand siar co Cathal, conad and-sin as-bert Rumand fili Fergail and so:";
segments[12000088]="Robíth Fergal fer caín cnedmar, gríb glond galann; rogob óengol amal toraind ó tá Indsi Modh co Manaind.";
segments[12000089]="Is and-sin didiu baí Cathal a n-Glendamain na ríg ac Sléb Chrot, & in slóg do-deochaid lasin ceand rotriallad a marbad la Cathal, uair ba h-olc lais díth Fergail dar ceand a shída.";
segments[12000090]="Dofoilced rofigedh roslemanchírad do chind Fergail iar sin la Cathal & do-bretha bréid sróill uime iar sin, & do-bretha secht n-doim & secht muilt & secht tindi & siad uili fonaigthi ar bélaib cind Fergail; rohimdergad iar sin imon ceand a fiadnaisi fer Muman uili & dofoslaic a shúili ria Dia do altugad na h-airmiden & na h-anóra móiri-sin tucad dó.";
segments[12000091]="Rofodlad iar sin la Cathal in biad-sin do bochtaib na cell comfhocus baí dóib .i. Áth Chros Mo-Laga & Tulach Min Molaga.";
segments[12000092]="iar sin Cathal co n-gléri tinóil fer Muman les d'idnocol chind Fergail como-tarad fén d'Uíb Néill. co tarad rígi Úa Néill do Flaithbertach mac Áeda, & fácbais Cathal amlaid-sin iad & tánic co Gleandamain na ríg i cind cháectigis ar mís.";
segments[12000093]="Is iar sin trá rofigh cocad mór i Laignib i n-agaid Cathail meic Findgune, & co rothinóil Cathal fir Muman les, & co n-deachaid a n-agaid Fáelán ríg Laigen co Laignib uili aráen ris & curter and-sin cath Féli iter Fáelán & Cathal, & do-cer Fáelcar; rí Osraidi and & brister an cath ar Laignib.";
segments[12000094]="Imscarad Cathail & Laigin connuigi sin.";
segments[13000001]="Cath Almaine so.";
segments[13000002]="Boí cocad mór etir Cathal mac";
segments[13000003]="guine rí Lethe Moda & Fergal mac Moíle-dúin rí Lethe Cuind ri ré cian.";
segments[13000004]="Rocrech Laigin trá Fergal mac Maéile-dúin ar ulc ri Cathal mac Findguine.";
segments[13000005]="Roairg dno Cathal Mag m-Breg ule co n-dersat síth & comfhossad iarom.";
segments[13000006]="Do-luid trá fecht ann atuaid Fergal mac Maíli-dú do saigid bóroime for Laignib co feraib in tuaiscirt imbi.";
segments[13000007]="Bá fota trá bás oc tinól la Fergal.";
segments[13000008]="Ass ed at-bered cech fer fris: 'dá ndech Donn Bó lat, ragat-sa lat.";
segments[13000009]="Bantrebtoch immorro máthair Dhuind Bó; mac is áinem & is áilemh boí a n-É in Donn Bó.";
segments[13000010]="Ní roléic immorro a máthair do Donn Bó áen ri Fergal cu tarat Fergal ráith Col Cille friasi im bhethaid Duinn Bó doridissi a docum.";
segments[13000011]="Tánic iar sain Fergal do shaigid Laigen.";
segments[13000012]="Bádar imorro droch-eolaig ria Fhergal & tucsat for tóirigecht for aimréid na coicríche Is í iarum nucsat ind eolaig .i. do Cluain Dolchaill cha gabsat longport for brú na cilli & tuc-seoim imadhall mór forin cill .i. araile clam & boin aici.";
segments[13000013]="Rohin-deonad ar beruib iarnn Is ann-sin at-bert Cú-Bretán mac Áengusa .i. Fer At-ágar cath forderc flann, a fir Fergaile, brónach muinnter Mic Muire iar m-breith dia cind.";
segments[13000014]="Bó in claim, rogáet i n-degaid, mairg láim rotollai a brat ré techt i cath mac m-Brain.";
segments[13000015]="Má beth nech do-bera cath den drcman ri mac m-Brain; annsa dás ind róe in cóe rocechain in clam.";
segments[13000016]="Is ann-sin at-bert Fergal fri Donn mac sin ré tabairt in catha:";
segments[13000017]="‘déntar lfited anocht a Duinn Bó, ar issé fitiuch is dech roboí riam ind & runna & cuslind & cech ceinél athac issinn aímsir-sin.";
segments[13000018]="Ní fh Bó óen-fhocal for mo beóla nech aili tú anocht i r-rabuis im fid adia inocht’ ar Fergal ‘ar iss é ríg-drúith Érenn h-é’.";
segments[13000019]="Do-rónath dna amlaid ind oidchi-sin.";
segments[13000020]="Do-llotar Laigin iarnabárach cu Cruachan Cléonta.";
segments[13000021]="Táncatar far sain co Dind Canann.";
segments[13000022]="Is ann-sin trá cond-recait Leth Cuinn & Laigin cenn a cenn.";
segments[13000023]="Cath Almaine ainm in catha-sin.";
segments[13000024]="Ni roan didiu menma Coluim Cille for Uíb Néill issin cath-sain la h-ascin m-Brigde h-uas cath Laigin, cu r-róemid in cath ré n-Óed .i. rí Deiscirt Laigin; is é robris in cath for Fergal & Bili mac Báin rígh Alban & Donn Bó, & gu rotrasgrad Donn Bó ní romarbad Fergal.";
segments[13000025]="Romarbuit sesca ar cét do amsaib in ríg & Conall mac ríg Ceineóil Conaill Coirpri, & Forbasach rí Cenéil Bóguine, & Ferghal úa Aitechdai, & Fergal mac Ecdach Lemnai rí Tamnaigi, Condalach mac Conaing, & Éicnech mac olcan rí na n-Airter, Coibdenach mac Fiacrach, Muirgius mac Conaill, Leathaitech mac Con-charat, Áedgen úa Mathgne, Nuada mac Eirc rí Guill, & deich n-úi Máeili-fitrigh.";
segments[13000026]="Is é in sin ríg in tuascirt.";
segments[13000027]="It iat ann-so Uí Néill in Deiscirt romarbait ann .i. Flann mac Rogellaig, Ailill mac Feradhaig, Éid Lagin úa Cernaig, Suibne mac Conghalaig, Nia mac Cormaic, Dub-dá-crích mac Duib-dá-inber, Oilill mac Conaill Graint, Flaithemail mac Dlúthaigh rí Coirpri Cruim, Fergus úa Eogain.";
segments[13000028]="Hic totus numerus de regibus ceciderunt & ali novem uolatiles septem millia ceciderunt in eo bello ab utr in excercitu.";
segments[13000029]="Is ann-sin úa Mag ríg-drúth, & do-ratad fair géim do dénam.";
segments[13000030]="Robo mór trá in géim h-í-sin & robo bo fl éim uí Magline ac sochaide do feraib din.";
segments[13000031]="Do-ratad iar sin for a muinél co n-dechaid a cenn de boí géim uí Magline oc tofunn.";
segments[13000032]="Is ann-sin at-bert araile láech achtaib fria macu:";
segments[13000033]="‘nácham-fácaid a gill de frib menma far máthar’.";
segments[13000034]="Impáit iar bait leo h-é for cranna sleg.";
segments[13000035]="Do Allán mac Ferghaile cu ráinic in Gall Lilcach & cu roataigh in Gall .i. Lilcach larghi.";
segments[13000036]="Prudens dno ainm in Gaill-sin; go t-aingel for in cleith i r-richt in cléirigh, ar do-airngert cléirech bithanad issin chill-sin.";
segments[13000037]="Is ann-sin bert éad Allán mac Fergaile:";
segments[13000038]="Ní ráncamar ar talmain Almuin badi réidhitir;";
segments[13000039]="Ní fhuaramar iarsin cath Lilcach ulccach badid némidir.";
segments[13000040]="Roanacht immorro Cú-Bretan mac Áengusa .i. rí b-Fher Ross.";
segments[13000041]="Bátar immorro Laigin ic flegugad & ic ól in aidchi-sin.";
segments[13000042]="Is-bert iarum Murchad mac Brain fri h-óenfer istich dint slógh dula ar cenn cind duine san ármhuig, & do-bérad secht cumala dontí noraghad.";
segments[13000043]="‘Raghat-sa ann’, for óclach amra do feraib Muman.";
segments[13000044]="Luid-sein immach & a errad catha uimbi co rocht corp Fergail co cuala in n-escaire issinn aíer, co r-roclois uili frisie.";
segments[13000045]="‘Timmarnad dúib do muig nime airfitiud for tigerna do dénam anocht .i. Fergal mac Máeile-dúin; do-rocrabhair in bur n-éicsib uile sunn aráen ri bur tigerna .i. ri Ferghul.’";
segments[13000046]="Ro-cualatar immorro in ceol iar tain etir áes dána & cornaire & cuislennchu & cruitire, co cuala inní na ceola écsamla ní riam ná iarum ceol bu ferr.";
segments[13000047]="Co cuala dna in cnoinsig sent shup luacra.";
segments[13000048]="Ba binde in ceol hí-sin oldát ciúil in domuin.";
segments[13000049]="int óclách die n-docum iar sin. ‘Ná tair cucum’, ar in cenn fris.";
segments[13000050]="‘Cid ón cid taeí’.";
segments[13000051]="‘Missi Donn Bó’, ar in cend, ‘& donaisced form airfitiud do dénam dom tigerna indnocht .i. do Fergal Murchad’, or in cenn.";
segments[13000052]="‘Caide Fergal féin’, or int óclach ‘taitnemach frit anall’ ol in cenn.";
segments[13000053]="‘Cesc otbér’.";
segments[13000054]="‘Is tú is dech lem nom-bera’, for ina ‘minam-berad Crist mac Dé’.";
segments[13000055]="‘Dánom-bera la’, or in cenn, ‘gonom-tuca gom colaind doridhisi’.";
segments[13000056]="‘In tuca at ní assin ármagh’, or Murchad.";
segments[13000057]="‘Tuc’, ar int óg ‘Tabuir forsinn uaithne tall’, or Murat in sluag uile aithne fair & doráidsed:";
segments[13000058]="‘nirb irsan duit, a Duind Bó, beith amlaid-sin; is & is ferr airfitiud boí a n-Ériu.’";
segments[13000059]="‘Maith’ ech, tuc a muich in cenn:";
segments[13000060]="‘déna oirfitiud, a Duinn Bó, fo dáigh Meic Dé .i. Íssu Críst a n-dechaid g s.";
segments[13000061]="Airfid Laigniu indocht amal doairfitis do tigerna ó cianaib.’";
segments[13000062]="Impóis Donn Bó a aigidh fri fraigid in tichi ar dáig comadh doreha dó, & do-rat a crúisic as combá binde oldás cacha ceol ar talmain, co rabatar int sluaigh uile oc caí & oc toirrsi fri truaigi & tadiúiri in ceoil.";
segments[13000063]="In tan trá ba scíth in sluagh oc torrsi.";
segments[13000064]="int óclach cétna lasin cenn eo riacht a corp. ‘Maith éim’, ol in cenn frissin óclach:";
segments[13000065]="‘tudhmi dam mo cend frim corp’; córaigid dno int óclach in cenn forsin eoluinn & len di fo cétóir, & do comallad bréithir n-Dé & Coluim Cille ria slánaisec fo tuaid docum a máthar doridhissi cu roindis scéla in catha & aidedh Fhergail.";
segments[13000066]="n-écmuis Cathail meic Findg e dno rocuirsi Laigin cath Almuine & rup olc le Cathal in cath do cur na ingnais. Ó 't-cualatar Laigin grúcán Cathail do beith Conid h-í comairli do-rónsat, cend Fergail do breith cu Cathal do commaídem in catha.";
segments[13000067]="Rucad iarum in cenn co Cathal.";
segments[13000068]="Conid ann-sin is-bert Ruman file Fergail:";
segments[13000069]="Robíith Fergal fer caín cennmar, gríb glond galann; rogab óengol amal torainn ó tá In Mog co Manaind.";
segments[13000070]="n-Glendomhuin na ríg roboí Cathal in tan-sin & in slóg do-dechaid lasin cenn rotrial a marbad la Cathal ar rop olc leis díth Fergail enn t-sídha. Rofoilced iar tain cenn Fergail ic Cathal & do-breth bréit sróill imme, & do-bretha secht n-daim & secht tinne até fonaigthi ar bélaib cind Fergail.";
segments[13000071]="Rohimdergad didiu im i fiadhnuissi fer Muman uile & rooslaic a súile do atlaghad na h-airmiten-sin do-ratad dó.";
segments[14000001]="Cath Almhaine idir Laigniu, & Ui Néill intertíd Decimbris ra cuiredh an cath-sa.";
segments[14000002]="Cáuis an chatha-sa .i. an boromha ro mhaith Finnachta do Moling, atobhach d-Fergal, & issedón nara fuilngeador Laigin.";
segments[14000003]="Nis tuccsat Laigin do Loingsech mac Aongusa, & ní tucsat do Congal Cinnmhaghair, cía ro fuilngettur mór dimnedh ó Congal, & ní moo dno robail doibh athabhairt d-Fergal, uair ro tairisnigh-siot i m-briathraibh Moling ra geall na bertha uatha tré bítha an boromha o Laignib.";
segments[14000004]="Bá trom tra la Fergal sin .i. Laigin do nemhchomhall";
segments[14000005]="angeallta fris, go ro fuacradh sluaigedh direcra dimór úadh for Leth Cuinn .i. for Eogan & for Conall, & for Airgiallaibh & Mídhe an cetramadh bliadain a flaitiusa féin, no itress bliadain déc, ut quibusdam placet, do thobhach na boromba.";
segments[14000006]="Ba fada tra ro bhás og an tinól sain; uair assedh ad-beiredh gac fer do Leith Cuinn gus a roicheadh an fuaccra .i. dá t-tí Donnbó ar an sluaghadh raghad-sa.";
segments[14000007]="Donnbó immorro mac baintreabtaighe eisidhe d-Feroibh Rois, agasní deachaidh lá na aidhchi a taigh a mathar imach ríamh, & ní raibhe in Eirinn uile budh caoímhe, no budh ferr cruth, no delbh, no denamh inás.";
segments[14000008]="Ni rabha i n-Eirinn uile budh griubhdha, no budh segaine inás, & as uadh budh ferr rann espa, & risgéla for domhon.";
segments[14000009]="Asé budh ferr do ghlés ech, & do indsma slegh, & d-fighe folt, & budh fer riaichni na einech de quo dicitur.";
segments[14000010]="Aille macaibh Donnbo baidh, binne a laidhe luaidhid beoil, aine ogaibh Innsi Fáil, ra thogaibh tain trillsi a threóir.";
segments[14000011]="Niar licc dno amathair Donnbo la Fergal go t-tuccadh Máol mac Failbhe, meic Erannain, meic Criomhthainn comarba Coluim Cille fria aisic beó, & go t-tuccsaidhe Colum Cille dno dia chionn go risedh Donnbo slán da taigh fein a crích Laigen.";
segments[14000012]="Tocomla dno Fergal for séd.";
segments[14000013]="Ra battur dna lucht eólais reimhe, nir bó maith an t-eólus do radsad dó.";
segments[14000014]="ed ón iccumhgaibh gacha conaire & i n-aimhredhibh gacha conare, go rancuttur Cluain Dobail in-Almaine.";
segments[14000015]="As ann buí Aodhan clamh Cluana Dobhail ara chinn.";
segments[14000016]="Do ronsad dno na slúaigh micostadh .i. aaonbhó do marbadh & afuine ar bheraibh na fhiaghnaisi & athech do bhreith da chinn & a losccadh; Con-er-bert an clamh comba digal go bráth for Uibh Neill an digal do beradh an coimdidh farsin.";
segments[14000017]="tainicc an clamh remhe go puball Fergail, & battur rioghradh Leithe Cuinn uile ara chinn sin phuball in-tan-sin.";
segments[14000018]="Ro baoí an clamh ag acaoine a imnidh na f-fiaghnaisi, ní tainig cridhe neich dibh fair, acht cridhe Conbretan meic Congusa rí f-Fer Rois, & asedh onna ba h-aithrech do Coinbretan, uair ni terna rí do nech ro bhaoí isin phuball acht Cubreatan mac Oengusa aáonar asin chath.";
segments[14000019]="Conadh ann ad-bert Cubretan:";
segments[14000020]="Ad-ágar cath fordearg flaind a fhir Fhergaile adglionn badh bronaigh muintir Meic Maire ar m-breith an taighe dar cionn.";
segments[14000021]="Bo an chlaimh ro gaod andeaghaid a daim, mairg laimh ra toll ambrad ar ní thimcomart mac Brain.";
segments[14000022]="As andsin as-pert Fergal fria Donnbó; ‘déna airfidedh dúin a Doinnbó, fo bith as tú as deach airfididh fail i-n-Eirinn .i. i-cuisigh, agas i-cuislendoibh, & i-cruitibh, & randaibh, & raidsechoibh, & rigsgelaibh Eirenn, & isin madinsi imbarach do beramne cath do Laignib’.";
segments[14000023]="‘Ac’ ar Donnbó ‘ní cumhgaim-si arfidedh dhuit-si anocht, & nimthá aongniomh dibh sin uile do taidbh-sin anocht, & cip-si áirm irabhai-si amarach, & imbeó-sa do dhén-sa airfidedh duit-si.";
segments[14000024]="Dénadh immorro an rioghdruth ua Maighléine airfidedh dhuit anocht’.";
segments[14000025]="Tugad ua Maighleni chuca iarttain.";
segments[14000026]="Ro gabh-saidhe og indisin cath & comramha Leithe Cuinn, & Laigen, o thoghail Tuama Tenbath .i. Deanda Rígh in ra marbhadh Cobhtach Caolbhregh, conigi an-aimsir-sin, & ní bá mór codalta do rinnedh leó in-aidhchi sin rá méd egla leo Laigen, & la méid na doininne .i. uair aidhche fhéle Finniain gaimhridh sin.";
segments[14000027]="Imthús Laigen do-lottur-saidhe i-Cruachán Claonta, dáigh ní mhaidh for Laigniu da n-dearnat acomairle ann, & gurob tíusad do chum an chatha.";
segments[14000028]="Lottur iarsain go Dinn Canainn, a-saidhe do chum an chatha.";
segments[14000029]="Con-rancuttur tra isin maidin ar na marach, na catha cechtardha, naoí míle do Laighnibh, míle ar fichit immorro do Leith Cuinn.";
segments[14000030]="As crúaidh & as feochair racuiredh an cath-sa leith for leth, & ra ghabh cach na chomraicibh ann: Ra ba dimór rá innisi comrama na laoch Laigen, & laoch Leithe Cuinn.";
segments[14000031]="As bert go f-facas Brighid ós cionn Laigen; ad ches dno Colum Cille ós cionn Ua Neill.";
segments[14000032]="Ra mheamhuidh iaramh an cath ría Murchadh mhac m-Brain, & re n-Aodh Mend mac Colgan Rí Laigen Deasgabair.";
segments[14000033]="Ra marbadh Feargal ann.";
segments[14000034]="Aodh Mend, & Dunchadh mac Murchadha ro marbhsat Fergal fadesin, & Bile mac Bain Rí Alban, as uaidh ainmnighther Corr bile in Almaine.";
segments[14000035]="Asé dno Aodh Mend ra marb Donnbó, ní torcair immorro Fergal go t-torchair Donnbó.";
segments[14000036]="Ra marbadh dno sesca ar cet amhus indú sin.";
segments[14000037]="A coimhlín féin ro-marbhaid Laighin san chath sin do Leit Cuinn .i. naoí míle; & naoí n-gelti dibh do thol for geltacht, & cét righ do righaibh.";
segments[14000038]="Atá Cnoc Fergail annsin.";
segments[14000039]="Ra chuirsiot Laigin ilaigh commaidmi and dno.";
segments[14000040]="Unde:";
segments[14000041]="Deodh laithe Almaine, ar cosnamh búair Breaghmaine, ro la badbh beldearg biorach, iolach imcenn f-Fergaile.";
segments[14000042]="Scarais Murchadh ra midlaigh, brogais a triuna i-t-talmuin, do soí faobhar fria Fergal.";
segments[14000043]="go f-fein dearmair des Almuin.";
segments[14000044]="Bath ann cet ruirech rathach, cruadhach costadach carnach im naoí n-gelta gan míne. naoi mile fer n-armach.";
segments[14000045]="Ceitri cet cabhsaidh a-Cruaich, las an amsaigh gaod san n-glíaidh latrí cedoibh Conaill cruaidh, asé.";
segments[14000046]="Ra gabhadh annsain an druth ua Maighleine, & do radadh fair geim druith do dhénamh, & do rigne, bá már, & bá binn an gheim-sin, go mair geim ui Magleine ósin ale oc druthaibh Eirenn.";
segments[14000047]="Ra gadadh achenn iarttain d-Fergal, & ra gadadh a cenn don drúth.";
segments[14000048]="Ra baoi mac alla gheimi an druith sin aieor go cenn tri la & tri n-oidhche.";
segments[14000049]="As de as-m-berar geim ui Maigleine og tafan na fer san monaidh.";
segments[14000050]="Do luidh dno Aodh Laighen mac Fithcheallaigh Rí Ua Maine Connacht iráon madhma, & teichidh go n-epert fria macoibh: ‘Nacham faccbaidh a maca, budh ferde bur mathair friu mo-breith-si lib’; ‘Nit berad’ or Laighin.";
segments[14000051]="Conadh annsin ro marbadh Aodh Laighen Rí Ua Maine.";
segments[14000052]="Ra siachtattur immorro a meic Aodha Laighen im Aodh Alláin mac Fergaile go Lilcach airm a-m-buí.";
segments[14000053]="Mo-dichu mac Amargin, & an Gall Craibhdheach.";
segments[14000054]="Ni f-fuaramar ar talmain Almain badid-redithir ni rangamar iarsin cath Lilchach badid nemethar.";
segments[14000055]="Ba buadhach tra an lá-sin do Laighnibh.";
segments[14000056]="Ra h-anact immorro Cubretan mac Congusa Rí f-Fer Rois ar na runna do righne an-aidhche reimhe. Condail na riogh battur Laigin an-aidhchi-sin ag ól fína & medha ar c-cur an chatha go subhach soimhenmnach, & cách diobh ag innisin a chomramha, isíad medraig medarcaoin.";
segments[14000057]="As andsin ra ráidh Murchadh mac Brain ‘Do berainn carpat cethre cumala, & mo ech, & merradh don láoch no raghadh isin n-ármach, & do béradh comhartha chugainn as’.";
segments[14000058]="‘Ragad-sa’ ar Baothghalach laoch di Mumain.";
segments[14000059]="Gebhidh achatherradh catha & comhlainn uime, go rainig go h-airm i-m-boí corp Fergaile, go c-cuala ní inesgairgaire isin aéor osa cinn con-d-epert. arclois uile, ‘timarnadh duibh ó righ Secht nimhe.";
segments[14000060]="Denaidh airfidedh da bar t-tigerna a nocht .i. d-Fergal mac Maoleduin, cia do rocrapair sunn uile inbhar naoís dána eidir cuislendchu, & cornaire, & cruitire na tairmesccadh er fhúath, no éccomhnart sibh dairfidedh anocht d-Fergal’.";
segments[14000061]="Go c-cuala iaramh an-t-oglach an cuisigh & an ceól sirechtach, go c-cúala dna san tum luachra bá nesa dhó an tórd fiansa bá binne ceólaibh.";
segments[14000062]="Luidh an t-oglach na tocum; ‘na tair ar mamus’ ar an cenn fris.";
segments[14000063]="‘Cesc cia thú?’ aran t-oglach.";
segments[14000064]="‘Ni ansa misi cend Duinnhó’ ar an cenn, ‘& naidm ro naidmedh form aréir airfidedh an rí a nocht, & na erchoididh dhamh’.";
segments[14000065]="‘Caidhe corp Fergail sunn?’ aran t-oglach.";
segments[14000066]="‘As e do aithtne frit anall’.";
segments[14000067]="‘Ceisc andad bér lem?’ aran t-oglach.";
segments[14000068]="‘As tú as deach lim: nom bera’ ar an cenn; ‘acht ráth Crist dod chinn danom ruga, go d-tuga me ar amus mo colla do ridhisi’.";
segments[14000069]="‘Do bér égin’ ar an t-óglaoch.";
segments[14000070]="im-poi an-t-oglaoch & an cenn lais conige Condail, & fuair Laigniu ag ól ar a chenn sin aidhchi cetna.";
segments[14000071]="‘An t-tugais comurtha lat?’ ar Murchadh, ‘tugas’ ar an t-oglac ‘cenn Dhuinnbó’.";
segments[14000072]="‘Furim aran fhuaithne úd thall’ ar Murchadh.";
segments[14000073]="Tugsat an sluagh uile aithne fair gur bé cenn Duinn bó, & asedh ra raidhsid uile:";
segments[14000074]="‘Dirsan dhuit a Duinnbó, bá cáomh do dhealbh, déna airfidedh cluinn a nocht, febh do rignis dot-tigerna imbuarach’.";
segments[14000075]="Impaighter a aighedh dno, & att-racht adord fiansa attruagh ar aird, go m-battur uile ag caoí, & ag tuirsi.";
segments[14000076]="Idhnaicidh an láoch cetna an cenn do chum a cholla amal ro geall, & coirghidh é ar a mheidhe.";
segments[14000077]="Cittracht, rainic Donnbó go tech a mathar.";
segments[14000078]="Uair assíad tri ionganta an chathasa .i. Donnbó do rochtain na bhethaidh gonige a thech dar chenn brethre Coluim Cille, & géim an druith ui Maigleine tri la & tri h-aidhce san aéor, & na naoí míle do foruaislig an míle ar fhichit.";
segments[14000079]="Unde dicitur:";
segments[14000080]="Cath Almaine ard a n-gein mór an gniomh Decembeir, rom bris Murchadh morda crech.";
segments[14000081]="mac Brain la laochraidh Laighnech Memhaidh ar Fergal Fail. armac Maoilidúin dermair.";
segments[14000082]="gom eltis muille fo leircc. arlintibh fola fordercc.";
segments[14000083]="Ocht righ ochtmoghad iar f-fior.";
segments[14000084]="naoí míle gan imarriomh.";
segments[14000085]="do Leith Cuinn comal n-gnaoi.";
segments[14000086]="do rochair ann ar anchaoi.";
segments[14000087]="Naoi n-geilte for gealtacht de.";
segments[14000088]="lottur diobh for Fidh n-Gaibhle ra claoclaidhsit dath iarttain.";
segments[14000089]="ara glethea Cath Almain.";
segments[14000090]="Haec sunt nomina regum qui interfecti sunt in hoc bello.";
segments[14000091]="Hi sunt quidem do Shíol Guinn.";
